Blockly.Blocks['google'] = {
    init: function () {
        this.appendValueInput("Suret")
        .setCheck(null)
            .setAlign(Blockly.ALIGN_RIGHT)
            .appendField(new Blockly.FieldImage("data:image/jpeg;base64,", 200, 200, "*"));
        this.setInputsInline(false);
        this.setColour(230);
        this.setTooltip("");
        this.setHelpUrl("");
    },
    val: 0,
    isCorrect: function(){
        var parent = this.getParent();
        return !parent;
    }
};

Blockly.Blocks['gismeteo'] = {
    init: function () {
        
        this.appendValueInput("Suret")
        .setCheck(null)
            .setAlign(Blockly.ALIGN_RIGHT)
            .appendField(new Blockly.FieldImage("data:image/jpeg;base64,", 200, 200, "*"));
        this.setInputsInline(false);
        this.setOutput(true, null);
        this.setColour(230);
        this.setTooltip("");
        this.setHelpUrl("");
    }, 
    val: 1,
    isCorrect: function(){
        var parent = this.getParent();
        return parent && parent.val+1 === this.val;
    }
};

